    start.addEventListener('click' , function(e){
        startGame();
    })
    const path = './resized/'
    const products = []
    for (let i = 0 ; i <= 12 ; i++)
        products.push(path  + i + '.png')
    function sleep(ms) {
        return new Promise(resolve => setTimeout(resolve, ms));
    }
    async function Fall(){
        var rand_id = Math.floor(Math.random() * 12)
        var rand_left = Math.floor(Math.random() * 60) + 20
        var rand_speed = (Math.random() * 10) + 5   
        var wait = Math.random() * 50000 + 500 
        var item = document.createElement('img')
        item.className = 'item_fall my-1'
        item.draggable = "true";
        item.src = products[rand_id]
        item.style.left = rand_left + '%';
        item.style.transition = 'all 1s';
        


        board.appendChild(item)
        item.style.display = 'none'
        await sleep(wait)
        item.style.display = 'block'


        const xOffset = item.clientWidth / 2;
        const yOffset = item.clientHeight / 2;


        var auto
        function ItemFallDown(i , item , speed ){
                auto = setInterval( async function() {
                item.style.top = i + 'px';
                i+=speed;
                var hei = document.documentElement.clientHeight
                if(i >= hei - (hei * 1 /100)) {
                    clearInterval(auto)
                    item.remove();
                } 
            }, 70);
        }
        ItemFallDown( 50, item, rand_speed)
        var int
        var mousePosition;
        var offset = [0,0];
        var isDown = false;
        var isMove = false
        item.addEventListener('mousedown', function(e) {
            clearInterval(auto);
            isDown = true;
            offset = [
                item.offsetLeft - e.clientX,
                item.offsetTop - e.clientY
            ];
        } , false);
        window.addEventListener('mousemove', function(event) {
            
            if (isDown) {
                item.style.transition = ''
                isMove = true;
                event.preventDefault()
                clearInterval(int)
                item.style.left = `${event.clientX - xOffset}px`;
                item.style.top = `${event.clientY - yOffset}px`;
            }
                
                if(!isMove) item.style.transition = 'all 0.5s'  
        },false);
        board.addEventListener('mouseup', function(e) {
            if(isMove){
                drag(e)

                isDown = false;
                function ItemFallDown(i , item , speed ){
                    int = setInterval(  function() {
                        item.style.top = i + 'px';
                        i+=speed;
                        var hei = document.documentElement.clientHeight
                        if(i >= hei - (hei *  1/100)) {
                            clearInterval(int)
                            item.remove()
                        } 
                    }, 50);
                }
                ItemFallDown( e.clientY - yOffset, item, rand_speed)
            }
            isMove = false;
        },false);
        const allCart = document.getElementById('cart')
        function ChongAnh(){
            var t_img = document.createElement('img')
            t_img.src = item.src 
            t_img.className = 'cart_image'
            var r_img = Math.floor(Math.random() * 45) - 45
            t_img.style.transform = 'rotate(' + r_img + 'deg)';
            allCart.appendChild(t_img)
        }
        function drag(e){
            const cart = document.getElementById('cart_img')
            var x1 = cart.getBoundingClientRect().x
            var x2 = x1 + cart.getBoundingClientRect().width
            var y1 = cart.getBoundingClientRect().y
            var y2 = y1 + cart.getBoundingClientRect().width
            if(e.clientX >= x1-(item.x* (10/100)) && e.clientX <= x2+(item.x* (10/100))  && e.clientY >= y1-(item.y* (10/100)) && e.clientY <= y2+(item.y* (10/100))){
                e.preventDefault()
                item.remove();
                ChongAnh()
                SoundCart();
                score++;
            }
        }
        var int2 
        var mousePosition2;
        var offset2 = [0,0];
        var isDown2 = false;
        var isMove2 = false
        item.addEventListener('touchstart', function(e) {
            clearInterval(auto);
            isDown2 = true
        } , false);
        item.addEventListener('touchmove',function(e){
                console.log('touch move')
                if(isDown2){
                    e.preventDefault()
                    clearInterval(int2);
                    isMove2 = true
                    mousePosition2 = {
                        x : e.changedTouches[0].clientX - 50 ,
                        y : e.changedTouches[0].clientY - 120
                    };
                    item.style.transition = ''
                    item.style.left = mousePosition2.x   + 'px';
                    item.style.top = mousePosition2.y  +'px';
                    
                }
            })
        item.addEventListener('touchend' , function(e){
            var el = e.changedTouches[0]
                    const cart = document.getElementById('cart_img')
                    var x1 = cart.getBoundingClientRect().x
                    var x2 = x1 + cart.getBoundingClientRect().width
                    var y1 = cart.getBoundingClientRect().y
                    var y2 = y1 + cart.getBoundingClientRect().width
                    if(e.cancelable)
                            e.preventDefault()
                    if(el.clientX >= x1-(item.x* (5/100)) && el.clientX <= x2+(item.x* (5/100))  && el.clientY >= y1-(item.y* (5/100)) && el.clientY <= y2+(item.y* (5/100))){
                        item.remove();
                        ChongAnh()
                        SoundCart();
                        score++;
                        
                    }
                if(isMove2){
                    item.style.transition = 'all 0.5s'

                    function ItemFallDown(i , item , speed ){
                        int2 = setInterval(  function() {
                            item.style.top = i + 'px';
                            i+=speed;
                            var hei = document.documentElement.clientHeight
                            if(i >= hei - (hei *  1/100)) {
                                clearInterval(int2)
                                item.remove()
                            } 
            
                        }, 50);
                    }
                    ItemFallDown( mousePosition2.y + offset2[1], item, rand_speed)
                }
                isMove2 = false;

        })
    }